Shopify does not have a built-in API for currency conversion. However, you can use third-party APIs like Open Exchange Rates or Google's Currency Converter API to handle currency conversion in your Shopify store.

Here's a basic example of how you can use Open Exchange Rates API in a Shopify script:

1. First, sign up for a free API key at https://openexchangerates.org/

2. In your Shopify admin, go to Apps > Manage private apps > Create a new private app > Set the admin API access level to Read and Write > Save.

3. In your Shopify theme, create a new script tag in the Asset folder (or any other appropriate location) and name it `currency-conversion.js`.

4. Paste the following code into the `currency-conversion.js` file:

```javascript
// Replace YOUR_API_KEY with the API key you received from Open Exchange Rates
const apiKey = 'YOUR_API_KEY';
const baseUrl = 'https://openexchangerates.org/api/latest.json';

function getRate(fromCurrency, toCurrency) {
  return fetch(`${baseUrl}?app_id=${apiKey}&symbols=${fromCurrency},${toCurrency}`)
    .then(response => response.json())
    .then(data => data.rates[toCurrency] / data.rates[fromCurrency]);
}

module.exports = {
  getRate: getRate,
};
```

5. In the same script tag, add the following code to call the `getRate` function and convert the price of a product:

```javascript
const currencyConversion = require('./currency-conversion');

function convertPrice(product, toCurrency) {
  return currencyConversion.getRate(product.price.currency, toCurrency)
    .then(rate => product.price.amount * rate);
}

